import {IndividualCard,I} from "./styles";
import { image } from "../../resources/Images";
function CardDisplay({ id,name,brand,price,rating,image}:any) {

    return (
      
      <IndividualCard>       
        <h2>{id}</h2>
        <p>{name}</p>
        <p>{brand}</p>
        <p>{price}</p>
        <p>{rating}</p>
        <div>
        <img src={image}></img>
        </div>
      </IndividualCard>
    );
  }
  export default CardDisplay;
